import React from 'react';

const pagination = ({ itemsPerPage, totalItems, paginate, currentPage }) => {
    // const { page, nbPages } = useGlobalContext();
    const pageNumbers = [];

    for (let i = 1; i <= Math.ceil(totalItems / itemsPerPage); i++) {
        pageNumbers.push(i);
    }

    return (
        <nav>
            <ul className='pagination'>
                {pageNumbers.map}
            </ul>
        </nav>
    )
};
